import { Users } from "../Users/users";

export const Row = ({ id, name }) => {
  return Users.map((user) => {
    return (
      <div>
        <td>{user.id}</td>;<td>{user.name}</td>;<td>{user.time}</td>;
        <td>{user.description}</td>;<td>{user.done}</td>;
      </div>
    );
  });
};
